(20, 'Fresh - Footer 3 Content', 'footer-3-content', '<div class=\"footer-top\">\n<div class=\"row no-gutters\">\n<div class=\"col-xl-3\">\n<h3>sign up for newsletter</h3>\n</div>\n<div class=\"col-xl-5 col-md-5\">\n<p class=\"des\">Enter your email address if you want to receive our newsletter.</p>\n</div>\n<div class=\"col-xl-4 col-md-7\">{{block class=\"Magento\\Newsletter\\Block\\Subscribe\" template=\"subscribe-footer.phtml\"}}</div>\n</div>\n</div>\n<div class=\"footer-middle\">\n<div class=\"logo-footer\">\n<div class=\"logo-ft\"><a href=\"#\"><img src=\"{{media url=&quot;wysiwyg/logo-ft.png&quot;}}\" alt=\"\"></a></div>\n<div class=\"des\">EcoGreen, a local Sudbury florist has served the Sudbury, area since 1975. When you work with Organic Food, you\'ll immediately see why the Charbonneau family has a reputation for delivering quality, value and service.</div>\n</div>\n<div class=\"row\">\n<div class=\"column col-sm-4 col-xs-12\">\n<div class=\"block-footer\">\n<div class=\"block-footer-title\">My Account</div>\n<div class=\"block-footer-content\">\n<ul>\n<li><a href=\"#\">My Account</a></li>\n<li><a href=\"#\">Log in</a></li>\n<li><a href=\"#\">My Cart</a></li>\n<li><a href=\"#\">My Wishlist</a></li>\n<li><a href=\"#\">My Compare</a></li>\n</ul>\n</div>\n</div>\n</div>\n<div class=\"column col-sm-4 col-xs-12\">\n<div class=\"block-footer\">\n<div class=\"block-footer-title\">Information</div>\n<div class=\"block-footer-content\">\n<ul>\n<li><a href=\"#\">About Us</a></li>\n<li><a href=\"#\">Customer Service</a></li>\n<li><a href=\"#\">Privacy Policy</a></li>\n<li><a href=\"#\">Search Terms</a></li>\n<li><a href=\"#\">Advanced Search</a></li>\n<li><a href=\"#\">Contact Us</a></li>\n</ul>\n</div>\n</div>\n</div>\n<div class=\"column col-sm-4 col-xs-12\">\n<div class=\"block-footer\">\n<div class=\"block-footer-title\">Why buy from us</div>\n<div class=\"block-footer-content\">\n<ul>\n<li><a href=\"#\">Support 24/7</a></li>\n<li><a href=\"#\">Freeshipping</a><